E_D("replace into `phome_ecms_game` values('1090','5','0','','','','1','admin','','1','0','1343190282','0','0','0','0','','','1090','0','0','0','0','0','0','蓝猫淘气三千问恐龙时代','1343190282','/spic/20120725/1177.jpg','0','1','1343190282','0','3','1','0','','0','','','667','479','　　地球遭到不明生物攻击，经调查是一种外来生物，是外星人利用恐龙基因重组新创的一种残暴复合恐龙，外星人想占领地球，为保卫地球，蓝猫等人奉命前往恐龙时代寻找恐龙基因。来到恐龙时代后，被救助的鸭嘴龙带蓝猫、淘气来到恐龙家族，恐龙家族把他们看作英雄，结下深厚友谊。在鸭嘴龙的帮助之下，暴风雨夜，蓝猫和伙伴们找到了的植食恐龙——副栉龙的家族。霸王龙，在恐龙家族中非常孤单，因为他好杀戮，脾气暴躁，蓝猫一次次救起被霸王龙杀戮的小恐龙。直到一次大泥石流灾难中，霸王龙遇险，蓝猫等舍身救助，霸王龙被感动了，原来他是一个流浪儿，从小就遭到同类排斥，当蓝猫和伙伴们给予他关爱时，他感动了……新的调查任务来了，在见多识广的霸王龙的带领下蓝猫调查小组进入新的地域，遭遇了暴龙…… <br /><br />','1','','0','','1','/dpic/20120725/1178.jpg','664','/donghuapian/664/1.html, /donghuapian/664/2.html, /donghuapian/664/3.html, /donghuapian/664/4.html, /donghuapian/664/5.html, /donghuapian/664/6.html, /donghuapian/664/7.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0278.jpg','http://www.61baobao.com/donghuapian/pic/05/0278.jpg','0','三个月以上','7','qiyi,38b48f7a4012400f8d4fc0776c5c8578|||qiyi,02c2a6864b054c47a740fa3b2aaceffc|||qiyi,d54d9ea2f1e74ddabbc2091ed9b5245a|||qiyi,5bf0e05d8e0f4ca2b802ad3edca17e35|||qiyi,872e360cf6454e7a8791a463f4c64aa3|||qiyi,4293a1d918844175b66e05e776a47822|||qiyi,f34a86ba2e3d46d68e22d154aa71e96f|||','0','','0','0','0');");
