E_D("replace into `phome_ecms_game` values('1101','5','0','','','','1','admin','','1','0','1343190295','0','0','0','0','','','1101','0','0','0','0','0','0','妙妙城','1343190295','/spic/20120725/1189.jpg','0','1','1343190295','0','3','1','0','','0','','','667','479','《妙妙城》讲述了一座童话城市日复一日的奇妙生活。这座城市和我们生活的城市一样，有学校，有工厂，有忙忙碌碌的人们和川流不息的车辆。故事的主人公是一群生活在妙妙城里的孩子们，他们性格各异，但他们同样快乐、自信、友善。孩子们在学校一起学习，放学了一起玩耍，是形影不离的好伙伴。在他们的成长中，也遇到了许多跟我们一样的问题：如何独自旅行，如何面对自己不擅长的事情，如何避免危险保护自己……他们凭着自己的努力，在成长道路上学到了许多知识，收获了很多快乐，无意中也制造了不少小麻烦。想知道他们是如何面对生活中一个又一个挑战的吗？欢迎来到妙妙城！','1','','0','','1','/dpic/20120725/1190.jpg','626','/donghuapian/626/1.html, /donghuapian/626/2.html, /donghuapian/626/3.html, /donghuapian/626/4.html, /donghuapian/626/5.html, /donghuapian/626/6.html, /donghuapian/626/7.html, /donghuapian/626/8.html, /donghuapian/626/9.html, /donghuapian/626/10.html, /donghuapian/626/11.html, /donghuapian/626/12.html, /donghuapian/626/13.html, /donghuapian/626/14.html, /donghuapian/626/15.html, /donghuapian/626/16.html, /donghuapian/626/17.html, /donghuapian/626/18.html, /donghuapian/626/19.html, /donghuapian/626/20.html, /donghuapian/626/21.html, /donghuapian/626/22.html, /donghuapian/626/23.html, /donghuapian/626/24.html, /donghuapian/626/25.html, /donghuapian/626/26.html, /donghuapian/626/27.html, /donghuapian/626/28.html, /donghuapian/626/29.html, /donghuapian/626/30.html, /donghuapian/626/31.html, /donghuapian/626/32.html, /donghuapian/626/33.html, /donghuapian/626/34.html, /donghuapian/626/35.html, /donghuapian/626/36.html, /donghuapian/626/37.html, /donghuapian/626/38.html, /donghuapian/626/39.html, /donghuapian/626/40.html, /donghuapian/626/41.html, /donghuapian/626/42.html, /donghuapian/626/43.html, /donghuapian/626/44.html, /donghuapian/626/45.html, /donghuapian/626/46.html, /donghuapian/626/47.html, /donghuapian/626/48.html, /donghuapian/626/49.html, /donghuapian/626/50.html, /donghuapian/626/51.html, /donghuapian/626/52.html, /donghuapian/626/53.html, /donghuapian/626/54.html, /donghuapian/626/55.ht