E_D("replace into `phome_ecms_game` values('1114','5','0','','','','1','admin','','1','0','1343190312','0','0','0','0','','','1114','0','0','0','0','0','0','塔拉星球之战','1343190312','/spic/20120725/1205.jpg','0','1','1343190312','0','3','1','0','','0','','','667','479','《塔拉星球之战》的故事发生在不远的将来，地球已经毁灭了，人类为了自身的生存入侵美丽如画的塔拉星球。崇尚和平的塔拉人玛拉联合人类飞船驾驶员吉姆，制定了拯救人类和塔拉星球的计划，一场“星际大战”即将展开…<br />','1','','0','','1','/dpic/20120725/1206.jpg','363','/donghuapian/363/1.html, /donghuapian/363/2.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/019.jpg','http://www.61baobao.com/donghuapian/pic/05/019.jpg','0','三个月以上','2','cntv,f06fb1fcc3084d19b218529b3937295f|||cntv,bcf5fdaa0f9e4bcc4bb00bae4e87d5c0|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1115','5','0','','','','1','admin','','1','0','1343190312','0','0','0','0','','','1115','0','0','0','0','0','0','向钱冲，向前冲','1343190312','/spic/20120725/1227.jpg','0','1','1343190312','0','3','1','0','','0','','','667','479','一向钱冲，向前冲讲述的是只逃命的小蚂蚁无意中闯入了一个书房，打破了书房的宁静。小蚂蚁吵醒了在盒子中沉睡的古币们，将军刀币大齐扶着夫人罗汉钱康康，书生开元通宝，还有其它的古币们都乱七八糟的从盒子中跑了出来，一片混乱中，袁大头掉下了桌子，钱币们四处寻找他的下落，却发现袁大头和两个奇奇怪怪的家伙在一起，刀币冲上前去……','1','','0','','1','/dpic/20120725/1228.jpg','492','/donghuapian/492/1.html, /donghuapian/492/2.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0135.jpg','http://www.61baobao.com/donghuapian/pic/05/0135.jpg','0','三个月以上','2','cntv,7d24f77829b345428b8872bc50db6196|||cntv,ac92a4ee3dbb4c67a005258981c27dd8|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1116','5','0','','','','1','admin','','1','0','1343190314','0','0','0','0','','','1116','0','0','0','0','0','0','功夫星猫','1343190314','/spic/20120725/1231.jpg','0','1','1343190314','0','3','1','0','','0','','','667','479','星猫武艺的练成、武学的体验与领悟习武成痴的师傅意外获得具有神奇力量的「五星石」，但双胞胎弟弟欲借五星石统一天下而兄弟阋墙。慌乱中星猫的师傅将星石植入星猫体内，星猫异变，除外型维持猫样外，行为举止及思考与人类无异。四只功夫星猫来到京城，开设“星猫快捷”公司为业。星猫们一边习武练功，一边寻找失踪的师傅。四只功夫星猫在快捷工作的日常生活中，运用机智和功夫解决遭遇到的各种困难或状况 。藉由每一集的故事的发展，主角在个性上、心智上、能力上、功夫和解决事情的能力都获得成长。','1','','0','','1','/dpic/20120725/1232.jpg','662','/donghuapian/662/1.html, /donghuapian/662/2.html, /donghuapian/662/3.html, /donghuapian/662/4.html, /donghuapian/662/5.html, /donghuapian/662/6.html, /donghuapian/662/7.html, /donghuapian/662/8.html, /donghuapian/662/9.html, /donghuapian/662/10.html, /donghuapian/662/11.html, /donghuapian/662/12.html, /donghuapian/662/13.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0276.jpg','http://www.61baobao.com/donghuapian/pic/05/0276.jpg','0','三个月以上','13','qiyi,e0eecc5ad2b34fc593c4344c5c23267f|||qiyi,c1164c1bd53d485195a0185abfa4191c|||qiyi,0c895d77c36e4eefb785e7088e82de2f|||qiyi,d5d5097d78ab425984ea2c6ea6fafd74|||qiyi,6b00a0d8cb6d4501ac1c5a90380f9f42|||qiyi,5d272ff8dd2d45bc9f54b091f33f0ac6|||qiyi,795e8b64529149d1a589bf7d5d5e86b3|||qiyi,ca513a433d8a4e66b138a40cefe68e93|||qiyi,654fd70d88af4c1aa9d1854d15ff04b8|||qiyi,6c8697dcc7e642babaffacfab425427e|||qiyi,bd68bf555dc742488b8ff3203c6fb567|||qiyi,e54614dd571b4932a7ff6b652188a329|||qiyi,251c21b6e3714a8cb543de7b73841de4|||','0','','0','0','0');");
