E_D("replace into `phome_ecms_game` values('1129','5','0','','','','1','admin','','1','0','1343190326','0','0','0','0','','','1129','0','0','0','0','0','0','勇敢雄心','1343190326','/spic/20120725/1253.jpg','0','1','1343190326','0','3','1','0','','0','','','667','479','影片设定在10世纪神秘的苏格兰高地，故事围绕一位鲁莽的公主玛瑞达（Merida）展开，作为国王弗格斯（Fergus）与王后埃莉诺（Elinor）的女儿，玛瑞达有着娴熟的弓箭技能；为了让人生留下独特的印记，冲动的她公然挑战三位不安分勋爵之间古老而神圣的习俗，不曾想这一举动竟导致国家陷入混乱与动荡之中，在求助巫婆“女智者”（WiseWoman）无果后，为了拯救家园、让生活重归美好，受到诅咒的玛瑞达必须拿出真正的“勇敢雄心”来改变自己的命运。<br />','1','','0','','1','/dpic/20120725/1254.jpg','501','/donghuapian/501/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0144.jpg','http://www.61baobao.com/donghuapian/pic/05/0144.jpg','0','三个月以上','1','cntv,82C5995A19AE4cf1AD9B70B5B7C42E10|||','0','','0','0','0');");
