E_D("replace into `phome_ecms_game` values('1131','5','0','','','','1','admin','','1','0','1343190328','0','0','0','0','','','1131','0','0','0','0','0','0','剑风传奇','1343190328','/spic/20120725/1249.jpg','0','1','1343190328','0','3','1','0','','0','','','667','479','剑风传奇架设于一个血统决定一切的社会里。在那个地方，无所谓公正与公平。寄生在下层阶级上的贵族，不断以荣誉、服从、高贵、正统来抹杀下层人的存在。而在那种社会里，出生平民的格里菲斯却远远望着远方的城堡，心中涌起无限的向往。对权利的向往，使得他走上了一条由杀戮铺成的梦想之路。格里菲斯的野心与才能造就了鹰之团的盛名。他的梦想同时也吸引了无数也想达到那个城堡的人义无反顾地追随着。','1','','0','','1','/dpic/20120725/1250.jpg','433','/donghuapian/433/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/082.jpg','http://www.61baobao.com/donghuapian/pic/05/082.jpg','0','三个月以上','1','cntv,7493AD9D473048d58C200B6C3DD2E7AB|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1132','5','0','','','','1','admin','','1','0','1343190328','0','0','0','0','','','1132','0','0','0','0','0','0','吉豆世运会','1343190328','/spic/20120725/1261.jpg','0','1','1343190328','0','3','1','0','','0','','','667','479','吉豆跟好友爵士、博士与朱朱被神奇力量吸入深海的神秘古国，更得悉他们其中一人是拯救生了病的地球之使者！自此吉豆与好友便须到各国进行体育比赛，以赢取用作医治地球的金草。面对各国实力强劲的对手，吉豆及好友有幸得到来自中国北京的新成员小碧加入，她有如传统中国女孩般温柔婉娴、热心可人，更是爵士舅父的徒弟，精通中国运动和功夫，尤其擅长轻功；在途上，小碧不但凭着好身手，屡次帮助吉豆等人脱险外，更向他们介绍各种中国文化、习俗及自然共融的思想，令这趟旅程添上无穷乐趣。','1','','0','','1','/dpic/20120725/1262.jpg','689','/donghuapian/689/1.html, /donghuapian/689/2.html, /donghuapian/689/3.html, /donghuapian/689/4.html, /donghuapian/689/5.html, /donghuapian/689/6.html, /donghuapian/689/7.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0292.jpg','http://www.61baobao.com/donghuapian/pic/05/0292.jpg','0','三个月以上','7','qiyi,f598c6b57a1143db8079233d4edaa17a|||qiyi,dea2ad0f469d448da92aeb9cdf540fb0|||qiyi,60e72c2bfbb24a03a9c29504dc525524|||qiyi,6cae1d3667fa4c6aa507cc896d001e3b|||qiyi,400497c06acf4bce9d47ab6701f9b771|||qiyi,5fec8dff05cb4407bd518fa4f07a6b57|||qiyi,65f6777e2a99450bba5cc74c0f06c366|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1133','5','0','','','','1','admin','','1','0','1343190329','0','0','0','0','','','1133','0','0','0','0','0','0','罗小黑战记','1343190329','/spic/20120725/1259.jpg','0','1','1343190329','0','3','1','0','','0','','','667','479','小黑是一只精灵，因为盗宝失败而被小白收养，取名罗小黑~失去妖力的它无法恢复人形~ 但是还有一定的法力。为了恢复，它暂时住在了小白家。','1','','0','','1','/dpic/20120725/1260.jpg','547','/donghuapian/547/1.html, /donghuapian/547/2.html, /donghuapian/547/3.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0161.jpg','http://www.61baobao.com/donghuapian/pic/05/0161.jpg','0','三个月以上','3','qiyi,b5e4916871524f15b28e9e47583f6f0c|||qiyi,fe068e161d304de48fb39964d8b2b7a6|||qiyi,a5a676f763f8454c9fc3165aeeb81628|||','0','','0','0','0');");
