E_D("replace into `phome_ecms_game` values('1138','5','0','','','','1','admin','','1','0','1343190333','0','0','0','1','','','1138','0','0','0','0','0','0','111寝室','1343190333','/spic/20120725/1263.jpg','0','1','1343190333','0','3','1','0','','0','','','667','479','本片描述的是住在“111”寝室里的6个女大学生日常生活的故事。通过几个故事片段讲述了，最初来自四面八方互不相识的6个人，通过共住“111”寝室，而成为亲密无间的“一家人”。本片叙事风格是散文式的，短片分四个小段落。首先，开场的6人浪漫相遇，然后第一故事的电话事件来引出“阿衰”作为线索人物，音乐段落都是在叙述寝室6人平时生活状态。最后一个故事是失恋事件，显露出寝室同学之间的小矛盾，但是只要外部矛盾一出现，寝室的内部矛盾就变得不是那么重要，大家一致对外，但最后还是回归寝室内部的小问题，以6个人之间特有的方式为事件结尾。最后，以开心的6人吃饭给短片划上句号，希望给人一种意犹未尽的感觉，她们的生活还在继续。','1','','0','','1','/dpic/20120725/1264.jpg','551','/donghuapian/551/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0165.jpg','http://www.61baobao.com/donghuapian/pic/05/0165.jpg','0','三个月以上','1','qiyi,aec41030477446cd9da53bd8d42de234|||','0','','0','0','0');");
