E_D("replace into `phome_ecms_game` values('1141','5','0','','','','1','admin','','1','0','1343190336','0','0','0','0','','','1141','0','0','0','0','0','0','恐龙危机第2部','1343190336','/spic/20120725/1269.jpg','0','1','1343190336','0','3','1','0','','0','','','667','479','　　恐龙重返地球的几年后，地球资源越来越匮乏，邪恶的跨国集团将目光盯上了恐龙。他们抢夺帕莫留下来的基因技术，秘密进行基因变异的研究，制造出了大量危险的变异恐龙。并且妄图利用变异恐龙组成的军队控制全世界。随着变异恐龙作乱事件层出不穷，邪恶集团的阴谋渐渐浮出水面。以X26为代表的政府与邪恶集团展开了一场研究对决，新的技术和更强的装备不断出现，X26凭借这些和自身的超能力，不断与被改造的恐龙对决。接着发生的，是在城市中蔓延开来的变异恐龙，它们肆意破坏暴动。X26成员和军队与恐龙展开了激烈的战斗，邪恶集团的阴谋被粉碎了。但让人始料未及的是，最后的战斗中，变异恐龙失控，它们攻击人类，并想占领整个地球。疯狂的攻击又开始了，人类不敌，被步步逼退，最后只能退居到一个小岛上坚守。人类陷入了严酷的生存危机。大家想起了帕莫曾留给人类的神秘通讯器，也许只有帕莫才能解除人类的危机。人类决定进入太空，再度寻找帕莫…… <br /><br />','1','','0','','1','/dpic/20120725/1270.jpg','666','/donghuapian/666/1.html, /donghuapian/666/2.html, /donghuapian/666/3.html, /donghuapian/666/4.html, /donghuapian/666/5.html, /donghuapian/666/6.html, /donghuapian/666/7.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0280.jpg','http://www.61baobao.com/donghuapian/pic/05/0280.jpg','0','三个月以上','7','qiyi,1bc2d71b0f224b069e33389e2daefad3|||qiyi,44d22e56ff7b4ae986f88c691cabe1e7|||qiyi,38b7a5721b2e47e593a345a63a5cdf38|||qiyi,707c233cf4dc423d8581d0e2f1a3ea3e|||qiyi,e90e3c29adb3478f9706d79b7a7ce41a|||qiyi,009b9fc76d114762a919916921f0a2db|||qiyi,2de645217f304823b600aad5a918d8aa|||','0','','0','0','0');");
