E_D("replace into `phome_ecms_game` values('1147','5','0','','','','1','admin','','1','0','1343190343','0','0','0','0','','','1147','0','0','0','0','0','0','恐龙危机第1部','1343190343','/spic/20120725/1297.jpg','0','1','1343190343','0','3','1','0','','0','','','667','479','不久的未来，外星文明希尔人的巨大飞船帕莫向地球飞来，它携带了大量史前的恐龙，面对一个完全未知的文明，人类动用各方面的资源与帕莫展开接触，X26探索飞船奉命前往太空中对帕莫进行探索。帕莫强大的脉冲波对地球造成了空前的影响，X26成员冒着生命危险完成了对帕莫的探测任务。帕莫发过来的脉冲波中隐藏了发送给人类的信息，在希德和林向忠等专家的努力下，帕莫信息被成功解码，人类了解到了帕莫将把6400万年前带走的恐龙放回地球的意图。最终，通过英勇的X26特种队员的努力，并在杰出的恐龙学家林杰的帮助下，人类消除了对帕莫的误解，最终帕莫将恐龙卸下，并且留给了人类强大的基因科技。人类开始了与恐龙共存、基因技术全面发展的时代。','1','','0','','1','/dpic/20120725/1298.jpg','665','/donghuapian/665/1.html, /donghuapian/665/2.html, /donghuapian/665/3.html, /donghuapian/665/4.html, /donghuapian/665/5.html, /donghuapian/665/6.html, /donghuapian/665/7.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0279.jpg','http://www.61baobao.com/donghuapian/pic/05/0279.jpg','0','三个月以上','7','qiyi,1cf9104087f14228b137da56a9c36820|||qiyi,deea91fac4f74bd98273d8be33cd5f81|||qiyi,014ff3c5229143a4972f1d3ab21c2264|||qiyi,c48c42d42bfa4d008052f3880ae3f228|||qiyi,ce4946340a514e9c86eb548bfa69f0a7|||qiyi,e89a166fcebe41c8ba9fadaad3949f17|||qiyi,7577f38a88a242889ce873099d474b6d|||','0','','0','0','0');");
