E_D("replace into `phome_ecms_game` values('1172','5','0','','','','1','admin','','1','0','1343190370','0','0','0','0','','','1172','0','0','0','0','0','0','星猫历险记之书法篇','1343190370','/spic/20120725/1358.jpg','0','1','1343190370','0','3','1','0','','0','','','667','479','　　小黑怪在一次时空转换中，得到了一张描绘黑暗势力恢复原功的羊皮卷。黑魔王可以借助这张神秘的羊皮卷，找到隐藏在中华渊源的古代任何一特定时空中精神之光并可以占为己有。星猫及12星座族为了彻底消灭黑魔王独霸世界的野心，经历一次次时空冒险，将羊皮卷夺得并送回到它原来的地方。星猫和12星座族为了宇宙间的和平安宁，和黑魔王及手下进行着一次又一次的较量。','1','','0','','1','/dpic/20120725/1359.jpg','646','/donghuapian/646/1.html, /donghuapian/646/2.html, /donghuapian/646/3.html, /donghuapian/646/4.html, /donghuapian/646/5.html, /donghuapian/646/6.html, /donghuapian/646/7.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0260.jpg','http://www.61baobao.com/donghuapian/pic/05/0260.jpg','0','三个月以上','7','qiyi,f707fe54281d4d4ebd8c41dad5d0cf21|||qiyi,ed086f1f6de54223b39c3f1e38a99c42|||qiyi,f894c34c41744a21ba6bb070ec9f49e6|||qiyi,26494010f42c41868ae38a58e0b7206c|||qiyi,8546c59212124066b09233e9763e488b|||qiyi,322af91c534f441287934ff3e82fc137|||qiyi,931989ed504c4dc28448fbd67d388ab4|||','0','','0','0','0');");
