E_D("replace into `phome_ecms_game` values('1175','5','0','','','','1','admin','','1','0','1343190374','0','0','0','0','','','1175','0','0','0','0','0','0','Another','1343190374','/spic/20120725/1332.jpg','0','1','1343190374','0','3','1','0','','0','','','667','479','时间背景设定在1998年春天，主人公?原恒一刚转校至夜见山北中学，就感觉到班上的同学似乎都在惧怕什么，随后他发现少女美?芽衣似乎过于特别，并开始和她接触，而谜团也开始加深。','1','','0','','1','/dpic/20120725/1333.jpg','838','/donghuapian/838/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/07/041.jpg','http://www.61baobao.com/donghuapian/pic/07/041.jpg','0','三个月以上','1','cntv,c560d5d015784db5b991fa3fb1787549|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1176','5','0','','','','1','admin','','1','0','1343190375','0','0','0','0','','','1176','0','0','0','0','0','0','大狗监狱','1343190375','/spic/20120725/1334.jpg','0','1','1343190375','0','3','1','0','','0','','','667','479','《大狗监狱》讲了一个办公室小职员装束的主人公，突然发现自己莫名其妙的出现在一个监狱里，还没等他弄明白，发现监狱里的大狗狱警把他隔壁的犯人从他面前带走并处死，这时他意识到自己在死囚牢房，于是他想逃出去，但是几经周折还是被抓回来了，最后就要到他被处刑的时候，主人公由于极度害怕导致爆发，疯狂咬坏铁窗，从高高的监狱塔顶跳了出去，本以为自己摔死的主人公突然从梦里惊醒，发现自己在办公室里，刚松一口气，这时他的老板出现了，主人公发现自己的老板和狗狱警长得一模一样，故事结束。','1','','0','','1','/dpic/20120725/1335.jpg','640','/donghuapian/640/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0254.jpg','http://www.61baobao.com/donghuapian/pic/05/0254.jpg','0','三个月以上','1','qiyi,9859a5a272df48b6b2a28ff858ea7f50|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1177','5','0','','','','1','admin','','1','0','1343190375','0','0','0','0','','','1177','0','0','0','0','0','0','超凡的诺曼','1343190375','/spic/20120725/1372.jpg','0','1','1343190375','0','3','1','0','','0','','','667','479','该片讲述一个小镇遭到僵尸入侵，拯救小镇的希望落到了小男孩诺曼的身上，因为他拥有和死人对话的特异功能。小男孩将由科迪?斯密特?麦菲配音。该片是Laika继《鬼妈妈》之后第一部3D的动画片，将于2012年<br />','1','','0','','1','/dpic/20120725/1373.jpg','857','/donghuapian/857/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/07/059.jpg','http://www.61baobao.com/donghuapian/pic/07/059.jpg','0','三个月以上','1','cntv,85A5C43AB6A64672BA62404076C697E1|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1178','5','0','','','','1','admin','','1','0','1343190375','0','0','0','0','','','1178','0','0','0','0','0','0','BLOOD-C The Last Dark','1343190375','/spic/20120725/1336.jpg','0','1','1343190375','0','3','1','0','','0','','','667','479','在危机中，手持日本刀与<古物>战斗的少女小夜现身了。在浮岛地区所发生的可怖的事件中，失去了一切的小夜。文人与<塔>究竟要用<古物>作何种「实验」。最后，小夜对文人的复仇能够实现吗。现在，最后的战斗即将<br />','1','','0','','1','/dpic/20120725/1337.jpg','848','/donghuapian/848/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/07/050.jpg','http://www.61baobao.com/donghuapian/pic/07/050.jpg','0','三个月以上','1','cntv,2581e4f064f345e4ba1374d6f9f7ac2e|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1179','5','0','','','','1','admin','','1','0','1343190376','0','0','0','0','','','1179','0','0','0','0','0','0','地铁里的阳光','1343190376','/spic/20120725/1340.jpg','0','1','1343190376','0','3','1','0','','0','','','667','479','这是一个有关梦想与追求的故事。故事讲述的是生活在地铁站广播员小屋子里，地下角落的一盆小仙人掌。他孤独、无聊，与世隔绝。地铁站里的繁华与美丽完全不属于他。直到有一天，他看到广播员拿进屋的一束盛开的鲜花，他的心里默默燃起了羡慕……经过分析他找到了花朵的来源，就是光。当地铁站里关灯下班后，似乎一切都随着黑暗的来临谢幕了，但这时，他意外发现了一束光，于是开始了艰难的追寻——追萤火虫，追火车。当一切都慢慢消失，这世界重归平静，他似乎失去了一切，然而意想不到的事情又接踵而至了。这也许是梦幻，也许是现实，没有人知道，但我们只知道通过他的努力，他心中的那束花开放了，并且会永远开着…… ','1','','0','','1','/dpic/20120725/1341.jpg','639','/donghuapian/639/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0253.jpg','http://www.61baobao.com/donghuapian/pic/05/0253.jpg','0','三个月以上','1','qiyi,28fd74235bd6460f9e4763b358dd2d97|||','0','','0','0','0');");
