E_D("replace into `phome_ecms_game` values('1193','5','0','','','','1','admin','','1','0','1343190397','0','0','0','0','','','1193','0','0','0','0','0','0','勇者大冒险','1343190397','/spic/20120725/1364.jpg','0','1','1343190397','0','3','1','0','','0','','','667','479','相信大家初中时一定有过在家背着老妈偷玩游戏、被老妈发现后挨训的悲催记忆。本片是由中国传媒大学动画学院07级的四位应届毕业生创作，旨在通过一个初中小男孩在现实与游戏中穿越的故事，唤起大家童年里那令人啼笑皆非、亦或是唏嘘不已的记忆。','1','','0','','1','/dpic/20120725/1365.jpg','652','/donghuapian/652/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0266.jpg','http://www.61baobao.com/donghuapian/pic/05/0266.jpg','0','三个月以上','1','yiqi,2f9c6af5678e465b966fde3f9714b175|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1194','5','0','','','','1','admin','','1','0','1343190398','0','0','0','1','','','1194','0','0','0','0','0','0','一幅僮锦','1343190398','/spic/20120725/1384.jpg','0','1','1343190398','0','3','1','0','','0','','','667','479','　　古时候，大山脚下有一块平地。平地上有几间茅屋。茅屋里住有一个妲布，她的丈夫死去了，剩下三个孩子。大孩子叫勒墨，二的叫勒堆厄，最小的叫勒惹。妲布织得一手好壮锦。锦上织起的花草鸟兽，活鲜鲜的。人家都买她的壮锦来做背带心，被窝面，床毡子。一家四口，就靠妲布的一双手来过日子。有一天，妲布拿起几幅壮锦到圩上去卖。看见店铺里有一张五彩的画，画得很好。画上有高大的房屋，好看的花园，大片的田地；又有果园、菜园和鱼塘；又有成群的牛羊鸡鸭。她看了又看，心头乐滋滋的。本来卖锦得的钱，打算全都买米的，但因为爱这张画，就少买一点米，把画买了回家。','1','','0','','1','/dpic/20120725/1385.jpg','638','/donghuapian/638/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0252.jpg','http://www.61baobao.com/donghuapian/pic/05/0252.jpg','0','三个月以上','1','qiyi,d7cbba8d0e854e5f9ed26feef16a5492|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1195','5','0','','','','1','admin','','1','0','1343190399','0','0','0','0','','','1195','0','0','0','0','0','0','木鱼小瓜瓜','1343190399','/spic/20120725/1368.jpg','0','1','1343190399','0','3','1','0','','0','','','667','479','庙里的小和尚在扫地时遇见了一位美丽的女子，立刻动了心，但是涉世不深的他并不理解自己在面对什么。日常生活里小和尚脑海里不断浮现出女子的模样，他的依赖感，青春的萌动，爱情的向往和性的幻想全部交融在一起成为了寺院里的一个傻傻的木鱼脑袋。但当他不顾世俗追寻女子时，发现自己也许就不该有那一见钟情…… ','1','','0','','1','/dpic/20120725/1369.jpg','637','/donghuapian/637/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0251.jpg','http://www.61baobao.com/donghuapian/pic/05/0251.jpg','0','三个月以上','1','qiyi,53e615d3c0634c938b0c46a61b40d729|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1196','5','0','','','','1','admin','','1','0','1343190400','0','0','0','0','','','1196','0','0','0','0','0','0','猫和老鼠全集','1343190400','/spic/20120725/1388.jpg','0','1','1343190400','0','3','1','0','','0','','','667','479','　著名的《猫和老鼠》动画片是制片人弗雷德·昆比、导演威廉·汉纳及约瑟夫·巴伯拉于1939年创作的。继第一个动画短片《猫得到靴子》大获成功后,25年中米高梅电影公司拍制了100多部《猫和老鼠》动画片。这套动画片完全以闹剧为特色,情节十分热闹。<br />　　资料：<br />　　《猫和老鼠》(又译《汤姆和杰里》Tom&Jerry)是当今举世闻名的动画片,它的创造者威廉·汉纳(William Hanna)及约瑟夫·巴伯拉(Joseph Barbera)是美国好莱坞动画界的“传奇人物”。威廉·汉纳出生于新墨西哥梅尔罗斯,七岁时随父母迁居加利福尼亚,长大后,曾先后学习过工程学、新闻学和音乐。20世纪30年代美国经济大萧条时期,他在一家动画工作室打零工,担任故事编辑工作,雇主很快发现了他的才华,因而他不断地得到提拔,直至成为独立的动画片导演。<br />　　卡通画家约瑟夫·巴伯拉出生于纽约,自幼就有绘画天赋,起初他在一家银行工作,业余时间入迷地从事动画创作。他不同寻常的天赋与勤奋使他很快在一家动画工作室找到了自己喜爱的工作。1937年汉纳和巴伯拉第一次在米高梅电影公司动画工作室相遇。1938年汉纳从事动画片《乐一通》(Looney Tunes)与《梅里小旋律》(Merrie Melodies)的创作,巴伯拉在绘制动画片《特里通》(Terrytoons)。汉纳具有喜剧天赋和著名导演的组织才能,巴伯拉具有卓越的绘画天才,他们都认识到应该结成合作关系,从此开始了几十年的成功合作。1939年他们共同为米高梅电影公司执导动画片《猫咪搞到了靴子》(Puss Gets the Boot),当时动画片中的猫叫Jasper,老鼠叫Jinx。汉纳的故事编得十分生动,巴伯拉形象绘制得十分出色,特别是猫和老鼠的表情充满了动人的幽默趣,1940年这部动画片的第一集问世后便大为轰动,受到无数观众的欢迎。<br />　　由于米高梅电影公司不喜欢动画片中这两个主角的名字,于是举行读者竞选,最后改成了现在的汤姆和杰里。《猫和老鼠》完全以闹剧为特色,情节十分热烈。汤姆是一只常见的灰白色家猫,它有一种强烈的欲望,总想抓住与它同居一室却难以抓住的老鼠杰里,它不断地努力驱赶这些讨厌的房客,但总是遭到失败。而实际上它在追逐中得到的乐趣远远超过了捉住老鼠,即使偶尔捉住了杰里,结果也不知究竟该怎么处置这只老鼠!<br />　　《猫和老鼠》采用了猫与鼠的原型,他们的恶作剧非常有趣,不论游戏多么激烈紧张,杰里都知道它不会受到任何真正的伤害,而汤姆则总是难免受些皮肉之苦。杰里与尿布小灰鼠塔菲同住在这个人家的老鼠洞里,看起来像是被汤姆监视着,但杰里却非常机灵,总能使汤姆狡诈的诡计适得其反,总能让它自食其果。这个机灵老鼠与笨猫的故事,堪与米老鼠和唐老鸭的故事相媲美。没有动物世界中恃强凌弱的残酷,只有两个邻居之间的曰常琐事和纷争,诸如小老鼠杰里偷吃了汤姆的奶酪,汤姆把捕鼠器放到了杰里的洞门口等等,中间穿插的无数恶作剧和幽默片断,让人感受到久违的天真快意。它们之间的关系常在一瞬间发生变化——化敌为友或势不两立:为敌时绞尽脑汁,互不相让;为友时,亲如兄弟,谁也不记仇。<br />　　《猫和老鼠》共有116个漫画形象,每一集选2至3个不同性格的形象搭配在一起,叙述一个“噱头”故事。它的故事内容单一,总是出人意料,但又合乎情理,体现出作者的超人智慧。它采用的哑剧形式,完全依靠滑稽动作而不用对白,与《米老鼠和唐老鸭》相比,后者的故事究竟表述什么,有时并不容易搞清,而《猫和老鼠》的哑剧却明白直观,给观众的印象极其鲜明深刻。《米老鼠和唐老鸭》风靡世界几十年,其造型、配音以及强大的宣传起了重要的作用,而《猫和老鼠》几乎没有对白,靠的完全是生动的形象与情节曲折、想象丰富的故事。 《汤姆和杰里》前后共出过200多部动画片,其中《傻老鼠扬基》(1943年),《请安静》(1945年),《猫协奏曲》(1947年),《清洁鼠》(1948年),《两只凯蒂尔鼠》(1952年)和《老鼠约翰》(1953年)获得过奥斯卡金奖,《圣诞前夜》(1941年),《杰克尔博士和老鼠先生》(1947年)曾被提名,在好莱坞动画史上它是获得过奥斯卡金奖最多的动画片.','1','','0','','1','/dpic/20120725/1389.jpg','1','/donghuapian/1/1.html, /donghuapian/1/2.html, /donghuapian/1/3.html, /donghuapian/1/4.html, /donghuapian/1/5.html, /donghuapian/1/6.html, /donghuapian/1/7.html, /donghuapian/1/8.html, /donghuapian/1/9.html, /donghuapian/1/10.html, /donghuapian/1/11.html, /donghuapian/1/12.html, /donghuapian/1/13.html, /donghuapian/1/14.html, /donghuapian/1/15.html, /donghuapian/1/16.html, /donghuapian/1/17.html, /donghuapian/1/18.html, /donghuapian/1/19.html, /donghuapian/1/20.html, /donghuapian/1/21.html, /donghuapian/1/22.html, /donghuapian/1/23.html, /donghuapian/1/24.html, /donghuapian/1/25.html, /donghuapian/1/26.html, /donghuapian/1/27.html, /donghuapian/1/28.html, /donghuapian/1/29.html, /donghuapian/1/30.html, /donghuapian/1/31.html, /donghuapian/1/32.html, /donghuapian/1/33.html, /donghuapian/1/34.html, /donghuapian/1/35.html, /donghuapian/1/36.html, /donghuapian/1/37.html, /donghuapian/1/38.html, /donghuapian/1/39.html, /donghuapian/1/40.html, /donghuapian/1/41.html, /donghuapian/1/42.html, /donghuapian/1/43.html, /donghuapian/1/44.html, /donghuapian/1/45.html, /donghuapian/1/46.html, /donghuapian/1/47.html, /donghuapian/1/48.html, /donghuapian/1/49.html, /donghuapian/1/50.html, /donghuapian/1/51.html, /donghuapian/1/52.html, /donghuapian/1/53.html, /donghuapian/1/54.html, /donghuapian/1/55.html, /donghuapian/1/56.html, /donghuapian/1/57.html, /donghuapian/1/58.html, /donghuapian/1/59.html, /donghuapian/1/60.html, /donghuapian/1/61.html, /donghuapian/1/62.html, /donghuapian/1/63.html, /donghuapian/1/64.html, /donghuapian/1/65.html, /donghuapian/1/66.html, /donghuapian/1/67.html, /donghuapian/1/68.html, /donghuapian/1/69.html, /donghuapian/1/70.html, /donghuapian/1/71.html, /donghuapian/1/72.html, /donghuapian/1/73.html, /donghuapian/1/74.html, /donghuapian/1/75.html, /donghuapian/1/76.html, /donghuapian/1/77.html, /donghuapian/1/78.html, /donghuapian/1/79.html, /donghuapian/1/80.html, /donghuapian/1/81