E_D("replace into `phome_ecms_game` values('1198','5','0','','','','1','admin','','1','0','1343190402','0','0','0','0','','','1198','0','0','0','0','0','0','消失的文明','1343190402','/spic/20120725/1374.jpg','0','1','1343190402','0','3','1','0','','0','','','667','479','浩瀚宇宙……终将黑魔王封印……黑魔王元神复出，复出的元神只有黑暗的精神力量，可以聚合魔族，可是他的身体始终无法解封，这样黑魔王就无法施展它强大的力量。所以他企图通过坡坏……聚集生命能源……星猫族协同12星座降临……对抗邪恶。在星猫与12星座的奋战下，黑魔王的手下屡次失败，在无计可施之下，黑魔王命令粉团等人去“失落的文明”寻找可以一次打开封印的钥匙，顺便搜集精神之光。星猫与12星座洞悉了黑魔王的阴谋，一路追踪，黑魔王的手下来到许多曾经鼎盛一时的文明之地，古希腊，古罗马，古埃及……粉团，幻影，小黑怪等人为了找到传说中可以解开封印的神圣之光绞尽脑汁，用计策陷害星猫及12星座，如此危急的时刻，星猫挺身而出，大家团结一致，保护神圣之光，打败了黑魔王恢复了宇宙的和平。','1','','0','','1','/dpic/20120725/1375.jpg','647','/donghuapian/647/1.html, /donghuapian/647/2.html, /donghuapian/647/3.html, /donghuapian/647/4.html, /donghuapian/647/5.html, /donghuapian/647/6.html, /donghuapian/647/7.html, /donghuapian/647/8.html, /donghuapian/647/9.html, /donghuapian/647/10.html, /donghuapian/647/11.html, /donghuapian/647/12.html, /donghuapian/647/13.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0261.jpg','http://www.61baobao.com/donghuapian/pic/05/0261.jpg','0','三个月以上','13','qiyi,7048e8576370452a8e80f2a856ea3428|||qiyi,f6773b6791c34299b904a87f2d81f6ff|||qiyi,dee971facb1c4c3d8f56e5c30e62b820|||qiyi,358615917e76435694752d6977cf259c|||qiyi,88792dba7d904b89bb2ccd3bfcdabf5e|||qiyi,93baf78bdf2c4cb19d642532a87ab51c|||qiyi,e8255e1f03294b6f9edabff8d838e418|||qiyi,ab65187f1ec74ae9aebf26a2035b3f03|||qiyi,19b895d850114228902ab7f8c3fed63e|||qiyi,455d9486d744443fa467f30120a2ee6c|||qiyi,6d3d367b56fe40cea783721249aff1c5|||qiyi,f2cdf7c2fce44bfebdcad2fe22f34408|||qiyi,e460dd35de4d4ca8b50546139dec7a7d|||','0','','0','0','0');");
